interface ItemImage {
    name: string;
    imageUrl: string;
}

export const DATA_ITEM_IMAGE: ItemImage[] = [];

export const getItemImage = (itemName: string): string => {
    switch (itemName) {
        case 'sugar':
            return 'data:image/jpeg;base64,';
        case 'wheat':
            return 'data:image/jpeg;base64,';
        case 'clump of weeds':
            return 'data:image/jpeg;base64,';
        case 'sugarcane':
            return 'data:image/jpeg;base64,';
        case 'tomato':
            return 'data:image/jpeg;base64,';
        case 'potato':
            return 'data:image/png;base64,';
        case 'apple':
            return 'data:image/jpeg;base64,';
        case 'cherry':
            return 'data:image/jpeg;base64,';
        case 'horse mackerel':
            return 'data:image/jpeg;base64,';
        case 'manila clam':
            return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRWq_Ll6o2-P44m6G0FY1ekTg2aZfaJXNuqAQ&usqp=CAU';
        case 'squid':
            return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTFzisUdMcrAji-BWWQE0oQfhVqK3CvJdbjfQ&usqp=CAU';
        case 'anchovy':
            return 'data:image/jpeg;base64,';
        case 'red snapper':
            return 'data:image/jpeg;base64,';
        case 'flour':
            return 'data:image/jpeg;base64,';
        case 'apple tart':
            return 'data:image/jpeg;base64,';
        case 'pancakes':
            return 'data:image/jpeg;base64,';
        case 'Grilled sea bass with herbs':
            return 'data:image/jpeg;base64,';
        case 'aji fry':
            return 'data:image/jpeg;base64,';
        case 'cherry pie':
            return 'data:image/jpeg;base64,';
        case 'sardines in oil':
            return 'data:image/jpeg;base64,';
        case "pesce all'acqua pazza":
            return 'data:image/jpeg;base64,';
        case 'organic bread':
            return 'data:image/jpeg;base64,';
        case 'whole-wheat flour':
            return 'data:image/jpeg;base64,';
        case 'gnocchi di patate':
            return 'data:image/jpeg;base64,';
        case 'tomato curry':
            return 'data:image/jpeg;base64,';
        case 'squid-ink spaghetti':
            return 'data:image/jpeg;base64,';
        case 'squid-ink curry':
            return 'data:image/jpeg;base64,';
        case 'sea bass':
            return 'data:image/jpeg;base64,';
        case 'bread':
            return 'data:image/jpeg;base64,';
        default: null;
    }

    // check stored in new recipe
    if (DATA_ITEM_IMAGE.length) {
        const dii = DATA_ITEM_IMAGE.find(i => i.name.toLowerCase() === itemName.toLowerCase());
        if (dii && dii.imageUrl) { return dii.imageUrl; }
    }

    return 'data:image/png;base64,';
};